module gt4add3 (
  input [3:0] I,
  output [3:0] O
);
  wire I_0;
  wire I_2;
  wire s0;
  wire s1;
  wire s2;
  wire I_3;
  wire I_1;
  wire s3;
  assign I_0 = I[0];
  assign I_1 = I[1];
  assign I_2 = I[2];
  assign I_3 = I[3];
  assign s0 = ~ I_3;
  assign s3 = ~ I_2;
  assign s2 = ~ I_1;
  assign s1 = ~ I_0;
  assign O[0] = ~ (~ (I_0 & s3 & s0) & ~ (s1 & I_1 & I_2) & ~ (s1 & I_3));
  assign O[1] = ~ (~ (I_0 & I_1) & ~ (s1 & s2 & I_3) & ~ (I_1 & s3 & s0));
  assign O[2] = ~ (~ (s1 & s2 & I_2) & ~ (I_0 & s3 & I_3) & ~ (I_1 & s3 & I_3));
  assign O[3] = ~ (~ (I_0 & I_2 & s0) & ~ (s1 & s2 & I_3) & ~ (I_1 & I_2 & s0) & ~ (s3 & I_3));
endmodule

